import Axios from "axios";
function App() {
  var url="http://universities.hipolabs.com/search?name=${name}&country=${country}";
  async function getnames()
  {
    var result = await Axios.get(url); //api will take time to download so await is used.
    console.log(result.data);
  }
  return (
    <div className="App">
      <h1 onClick={getnames}>Hello Priya</h1>
    </div>
  );
}

